import Head from 'next/head';
import {useEffect, useState} from 'react';
import { Container, Row, Col, Card, CardBody, FormGroup, Alert, Form, CardHeader,
    CardTitle, CardText, CardFooter,Input, Button, FormFeedback, Label, InputGroup,
    InputGroupAddon, Breadcrumb, BreadcrumbItem, ListGroup, ListGroupItem, Media
} from 'reactstrap';

import { useFormik } from 'formik';
import * as Yup from 'yup';
import Link from 'next/link';
import styles from './profile.module.scss';

import { Email, Phone, Person, Group, Accessibility, Alarm,
        Message, ArrowRight, ArrowDropDown, Home, Repeat, Close,
} from '@styled-icons/material';

import DashboardLayout from "../../layouts/DashboardLayout";
import Titlebar from "../../components/Titlebar";



export default function Chat() {
    return (


        <DashboardLayout>
            <React.Fragment>

                <Row noGutters xs="3">
                    <Col>

                    	<Media>

							<Media left href="#">

								<img src="/images/users/avatar-1.jpg" alt="Group thumbnail"
									style={{width: "50px", height:"50px", borderRadius:"50%", alignSelf:"flex-end"}}/>

							</Media>

							<Media body>
						        <Media heading>
						          Media heading
						        </Media>
						        Fusce condimentum nunc ac nisi vulputate fringilla. Donec lacinia congue felis in faucibus.
						    </Media>
                    	</Media>

                    </Col>


                    <Col lg="8">

                       <Alert color="info"> chat box </Alert>

                    </Col>


                    <Col>

                       <Alert color="info"> profile dynamic</Alert>

                    </Col>


                </Row>




            </React.Fragment>

        </DashboardLayout>

    )
}
